import React from "react";
import ReactDOM from "react-dom";
import * as ques from './Clock';


ReactDOM.render(
    <>
<h1>Harshali</h1>

<p>{ques.you}</p>
<p>
    {ques.name}
</p>
<p>{ques.std()}</p>
<p>{ques.fr()}</p>
</>

,document.getElementById('root'));
